import { useEffect } from 'react';
import { useSelector } from 'react-redux';
import Navbar from './components/Navbar';

function App() {
  const { texts } = useSelector(state => state);

  useEffect(_ => {
    console.log(texts)
  }, [])
  return (
    <div className="App">
        <Navbar/>
        <div>
          <h3>Results:</h3>
          {texts?.map( t => <div key={texts.length-1}>{t.inverted}</div> )}
        </div>
    </div>
  );
}

export default App;
